import {React, useEffect, useRef} from 'react';
import '../styles/Home.css';
import Typed from "typed.js";

const home = () => {
  const el = useRef(null);

  useEffect(() => {
    const typed = new Typed(el.current, {
      strings: ["Handy", "Mandy", "Candy", "More Strings"], // Strings to display
      // Speed settings, try diffrent values untill you get good results
      startDelay: 300,
      typeSpeed: 100,
      backSpeed: 100,
      backDelay: 100
    });

    // Destropying
    return () => {
      typed.destroy();
    };
  }, []);

  return (
    <>
      <div id='stars'></div>
      <div id='stars2'></div>
      <div id='stars3'></div>
      <div className='container'>
        <h1>Hello, I am Dilpreet.</h1>
        <p class="intro-subtitle">
          <span class="text-slider-items"></span>
          <strong class="text-slider"><span class="sc-bdVaJa liKdQs">
          <span>Software En</span><span class="typed-cursor">|</span></span>
          </strong>
          </p>
      </div>
    </>
  )
}

export default home;
